Used for solo [[Utaite]]s who generally operate independently, similar to the [[Indie Virtual Youtuber]] tag.

If the indie Utaite in question is:

* part of a broader Utaite group consisting of at least one more Utaite, the copyright tag instead would be that of that given group, to account for the (hash)tags that the individual character tags couldn't include under their wiki's Other Names;
* sharing a channel with at least one (1) more Utaite, the copyright tag would be of the channel instead, for similar reasons as above;
* sharing an agency/company with at least one (1) more Utaite that has a tag on site, the copyright tag would be of that given agency instead;
* depicted with their real self and not their online persona, and they don't meet any of the above criteria, they should be tagged with [[real life]] instead of this tag;

Due to the flexible nature of utaite, being able to be independent or affiliated with agencies/corporate entities at a given moment, this tag can also serve as a "solo utaite" tag, as to not lead to the sudden creation of needless company tags. Previously, these utaite were tagged under the site they originated from (e.g. [[Niconico]]).
